import React from 'react';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';

import './Login.scss';

const useStyles = makeStyles({
  root: {
    width: '100%',
    maxWidth: 500,
  },
  h2: {
    fontSize: '20px'
  }
});

function Login() {
  return (
    <Grid container>
      <Typography variant="h2" component="h2" className={useStyles.h2}>Login</Typography>
      <Grid item xs={12}>
        <TextField
          id="login-email"
          label="Email"
          margin="normal"
        />
      </Grid>
      <Grid item xs={12}>
        <TextField
          id="login-password"
          label="Password"
          type="password"
          margin="normal"
          autoComplete="current-password"
        />
      </Grid>
      <Grid item xs={12}>
        <Button
          variant="contained"
          color="primary"
          size="large"
          margin="normal"
        >
          Login
        </Button>
      </Grid>
    </Grid>
  );
}

export default Login;
